import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';
import styled from 'styled-components';

const DetailContainer = styled.div`
  min-height: 100vh;
  background: linear-gradient(135deg, #1a1a1a 0%, #2a2a2a 100%);
  color: #fff;
  padding: 2rem;
`;

const PrintableContent = styled.div`
  max-width: 800px;
  margin: 0 auto;
  background: rgba(255, 255, 255, 0.05);
  border-radius: 20px;
  padding: 2rem;
  backdrop-filter: blur(10px);
  border: 1px solid rgba(78, 205, 196, 0.2);

  @media print {
    background: white;
    color: black;
    border: none;
    padding: 20px;
  }
`;

const ItemHeader = styled.div`
  text-align: center;
  margin-bottom: 2rem;

  h1 {
    color: #4ECDC4;
    font-size: 2.5rem;
    margin-bottom: 1rem;
  }
`;

const ItemImage = styled.img`
  width: 100%;
  max-height: 400px;
  object-fit: cover;
  border-radius: 10px;
  margin-bottom: 2rem;
`;

const ItemSection = styled.section`
  margin-bottom: 2rem;

  h2 {
    color: #4ECDC4;
    margin-bottom: 1rem;
    display: flex;
    align-items: center;
    gap: 0.5rem;
  }
`;

const PrintButton = styled.button`
  position: fixed;
  bottom: 2rem;
  right: 2rem;
  padding: 1rem 2rem;
  background: #4ECDC4;
  color: #1a1a1a;
  border: none;
  border-radius: 50px;
  cursor: pointer;
  transition: all 0.3s ease;

  &:hover {
    transform: translateY(-2px);
    box-shadow: 0 5px 15px rgba(78, 205, 196, 0.3);
  }

  @media print {
    display: none;
  }
`;

function ItemDetail() {
  const { id } = useParams();
  const [item, setItem] = useState(null);

  useEffect(() => {
    // 这里应该是从API获取数据
    // 暂时使用模拟数据
    const mockItem = {
      id: parseInt(id),
      title: '神秘的青铜门把手',
      description: '这是一个雕刻着龙纹的古老门把手，据说曾经属于一位著名的收藏家...',
      image: 'https://images.unsplash.com/photo-1461360228754-6e81c478b882',
      location: '知识花园区域',
      rarity: 'SSR',
      clue: '在书架与书架之间，寻找一扇被遗忘的门',
      story: '传说这个门把手曾经是通往一个秘密藏书室的钥匙，只有在月圆之夜才会显现其真正的模样。',
      discoveredBy: '探索者小明',
      discoveryDate: '2024-01-15',
      additionalInfo: '这个门把手上的龙纹在特定角度下会泛出青色的光芒...',
      discoveryStory: '那是一个月圆之夜，我在整理古籍时意外发现了这个门把手...'
    };

    setItem(mockItem);
  }, [id]);

  const handlePrint = () => {
    window.print();
  };

  if (!item) {
    return <div>Loading...</div>;
  }

  return (
    <DetailContainer>
      <PrintableContent>
        <ItemHeader>
          <h1>{item.title}</h1>
          <p>稀有度: {item.rarity}</p>
        </ItemHeader>

        <ItemImage src={item.image} alt={item.title} />

        <ItemSection>
          <h2>📜 物品描述</h2>
          <p>{item.description}</p>
        </ItemSection>

        <ItemSection>
          <h2>🗺️ 寻宝线索</h2>
          <p>{item.clue}</p>
        </ItemSection>

        <ItemSection>
          <h2>📖 背后的故事</h2>
          <p>{item.story}</p>
        </ItemSection>

        <ItemSection>
          <h2>🔍 发现过程</h2>
          <p>{item.discoveryStory}</p>
        </ItemSection>

        <ItemSection>
          <h2>ℹ️ 额外信息</h2>
          <p>{item.additionalInfo}</p>
        </ItemSection>

        <ItemSection>
          <h2>📍 基本信息</h2>
          <p>位置: {item.location}</p>
          <p>发现者: {item.discoveredBy}</p>
          <p>发现时间: {item.discoveryDate}</p>
        </ItemSection>
      </PrintableContent>

      <PrintButton onClick={handlePrint}>
        🖨️ 打印页面
      </PrintButton>
    </DetailContainer>
  );
}

export default ItemDetail;
